import React, { memo } from 'react';

const Chart = () => {
    return (
        <div className='flex p-8 relative  h-[200px] '>
            <div className='absolute top-0 bottom-0 left-8 right-6 bg-chart-bg'></div>
            <div className='absolute top-0 bottom-0 left-8 right-6 bg-chart p-2'>

            Chart
            </div>

           
        </div>
    );
}

export default memo(Chart);
